import "./App.css";
import { BrowserRouter, Route, Redirect, Switch } from "react-router-dom";
import AuthPage from "./pages/Auth";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Redirect from="/" to="/auth" exact />
        <Route path="/auth" component={null}></Route>
        <Route path="/gamesbookings" component={null}></Route>
        <Route path="/bookings" component={null}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
